import styled from 'styled-components';

export const Wrapper = styled.div`
background: var(--diceBackground);
width: 60px;
height: 60px;
display: flex;
align-items: center;
justify-content: center;
border-radius: 10px;

`;

export const Number = styled.h2`
font-size: 1.5rem;
`;
